// WAP to find cube of a num
package Day16;

public class WithRTandWithArg { 
	public int CubeOfNum (int a) {
		return  (a*a*a);
	}
	

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		WithRTandWithArg ob=new WithRTandWithArg();
		int re=ob.CubeOfNum(5);
		System.out.println(re);
	}

}
